import React from 'react';
import logo from './logo.svg';
// import './App.css';
import {Router} from '@reach/router';
import AllPets from './components/AllPets';

function App() {
  return (
    <div className="App">
      <Router>
        <AllPets path="/"/>
      </Router>
    </div>
  );
}

export default App;
